
const STAT_W_o={read__v:(s,e,_="text")=>{fetch(s).then((s=>{if(s.ok)return s[_]();throw new Error(`${s.status}: ${s.statusText}`)})).then((s=>{e(s)})).catch((s=>console.error(s)))},load_scan__v:s=>{STAT_W_o.read__v(`/assets/media/img/${s}/full/max/0/scan.json`,(s=>{self.postMessage({task_s:"put_scan",scan_a:s},[new ArrayBuffer(s)])}))},receive__v:s=>{const e=s.data;switch(e.task_s){case"load_scan":STAT_W_o.load_scan__v(e.id_s)}}};self.addEventListener("message",STAT_W_o.receive__v,!0);